import React from 'react'

class RoomList extends React.Component {

    click(sessionId){
        this.props.subscribeToRoom(sessionId).then(
        this.props.loadChat())

    }


    render () {
        return (
            <div className="rooms-list">
                <ul>
                    <h3>Your rooms:</h3>
                    {this.props.rooms.map(room => {
                        return (
                            <li key={room.sessionId} className="room">
                                <a
                                    onClick={() =>         this.props.subscribeToRoom(room.sessionId).then(
                                        this.props.loadChat())}
                                    href="#">
                                    # {room.userId}
                                </a>
                            </li>
                        )
                    })}
                </ul>
            </div>
        )
    }
}

export default RoomList
